import React, { Component } from 'react';
import { Grid, Cell} from 'react-mdl';

class Education extends Component {
    render() {
        return(
            <div>
                <Grid>
                    <Cell col={4}>
                        <p>{this.props.startYear}</p>
                    </Cell>
                    <Cell col={8}>
                        Right Side
                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default Education;
